{'action': 'created', 'issue': {'url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30064', 'repository_url': 'https://api.github.com/repos/spring-projects/spring-boot', 'labels_url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30064/labels{/name}', 'comments_url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30064/comments', 'events_url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30064/events', 'html_url': 'https://github.com/spring-projects/spring-boot/issues/30064', 'id': 1158934299, 'node_id': 'I_kwDOAGAU1s5FE-8b', 'number': 30064, 'title': 'Allow adding packages to entity scanning without disabling the default scanning ', 'user': {'login': 'odrotbohm', 'id': 128577, 'node_id': 'MDQ6VXNlcjEyODU3Nw==', 'avatar_url': 'https://avatars.githubusercontent.com/u/128577?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/odrotbohm', 'html_url': 'https://github.com/odrotbohm', 'followers_url': 'https://api.github.com/users/odrotbohm/followers', 'following_url': 'https://api.github.com/users/odrotbohm/following{/other_user}', 'gists_url': 'https://api.github.com/users/odrotbohm/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/odrotbohm/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/odrotbohm/subscriptions', 'organizations_url': 'https://api.github.com/users/odrotbohm/orgs', 'repos_url': 'https://api.github.com/users/odrotbohm/repos', 'events_url': 'https://api.github.com/users/odrotbohm/events{/privacy}', 'received_events_url': 'https://api.github.com/users/odrotbohm/received_events', 'type': 'User', 'site_admin': False}, 'labels': [{'id': 97741072, 'node_id': 'MDU6TGFiZWw5Nzc0MTA3Mg==', 'url': 'https://api.github.com/repos/spring-projects/spring-boot/labels/status:%20waiting-for-feedback', 'name': 'status: waiting-for-feedback', 'color': 'fef2c0', 'default': False, 'description': 'We need additional information before we can continue'}, {'id': 293438798, 'node_id': 'MDU6TGFiZWwyOTM0Mzg3OTg=', 'url': 'https://api.github.com/repos/spring-projects/spring-boot/labels/status:%20waiting-for-triage', 'name': 'status: waiting-for-triage', 'color': 'fef2c0', 'default': False, 'description': "An issue we've not yet triaged"}, {'id': 299875217, 'node_id': 'MDU6TGFiZWwyOTk4NzUyMTc=', 'url': 'https://api.github.com/repos/spring-projects/spring-boot/labels/status:%20feedback-reminder', 'name': 'status: feedback-reminder', 'color': 'fef2c0', 'default': False, 'description': "We've sent a reminder that we need additional information before we can continue"}], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 3, 'created_at': '2022-03-03T21:53:06Z', 'updated_at': '2022-03-14T09:56:23Z', 'closed_at': None, 'author_association': 'MEMBER', 'active_lock_reason': None, 'body': "I would like to provide a library that adds JPA entities to the persistence context bootstrapped. Ideally I would like to achieve that without the user having to explicitly configure `@EntityScan` to include the package of that library solely by registering some auto configuration.

I've tried both `@EntityScan` on a configuration class and a `BeanDefinitionRegistryPostProcessor` to trigger `EntityScanPackages.register(…)` but `EntityScanner` will only apply the autoconfiguration package as fallback if no entity package is configured at all.

I can see that the semantics of `@EntityScan` are supposed to stay unchanged. I'd be fine with a programmatic approach, so maybe an explicit method `EntityScanPackage.registerAdditional(…)` could populate an additional list that `EntityScanner` adds on top of the defaulted base list?", 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30064/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30064/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/comments/1066585031', 'html_url': 'https://github.com/spring-projects/spring-boot/issues/30064#issuecomment-1066585031', 'issue_url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/30064', 'id': 1066585031, 'node_id': 'IC_kwDOAGAU1s4_ksvH', 'user': {'login': 'odrotbohm', 'id': 128577, 'node_id': 'MDQ6VXNlcjEyODU3Nw==', 'avatar_url': 'https://avatars.githubusercontent.com/u/128577?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/odrotbohm', 'html_url': 'https://github.com/odrotbohm', 'followers_url': 'https://api.github.com/users/odrotbohm/followers', 'following_url': 'https://api.github.com/users/odrotbohm/following{/other_user}', 'gists_url': 'https://api.github.com/users/odrotbohm/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/odrotbohm/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/odrotbohm/subscriptions', 'organizations_url': 'https://api.github.com/users/odrotbohm/orgs', 'repos_url': 'https://api.github.com/users/odrotbohm/repos', 'events_url': 'https://api.github.com/users/odrotbohm/events{/privacy}', 'received_events_url': 'https://api.github.com/users/odrotbohm/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-03-14T09:56:23Z', 'updated_at': '2022-03-14T09:56:23Z', 'author_association': 'MEMBER', 'body': "It does indeed. At least until someone explicitly uses `@EntityScan` somewhere in their application configuration in which case the configuration would break. So some way of adding to the *entity* packages would still be appreciated. I think it'll also make the feature a bit more discoverable. The docs currently don't mention `@ACP` and the Javadoc of both annotations don't mention that fallback mechanism either, and the sole presence of `@EntityScan` makes it very likely that developers just try to use that if what they want to do is adding entities. ", 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-boot/issues/comments/1066585031/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

